import React from "react"
import { Box, Button } from "@mui/material"
import { IconPdf, IconCsv } from "@tabler/icons-react"
import { Product } from "@/app/(back)/backend/types/ProductTypes"
import { numberWithCommas, formatDate } from "@/app/utils/CommondUtil"
import jsPDF from "jspdf"
import "jspdf-autotable"

interface ExportProductProps {
  products: Product[]
}

const ExportProduct: React.FC<ExportProductProps> = ({ products }) => {

  const exportCSV = () => {
    const csvRow = []
    const header = ["ID", "Product", "Category", "Price", "Unit", "Created"]
    csvRow.push(header.join(","))

    products.map((product: Product, index: number) => {
      const row = [
        index + 1,
        `"${product.product_name.replace(/"/g, '""')}"`, // Handle quotes
        `"${product.category_name.replace(/"/g, '""')}"`,
        product.unit_price,
        product.unit_in_stock,
        formatDate(product.created_date),
      ]
      csvRow.push(row.join(","))
    })

    const csvString = csvRow.join("\n")
    const BOM = "\uFEFF" // UTF-8 Byte Order Mark
    const blob = new Blob([BOM + csvString], {
      type: "text/csv;charset=utf-8;",
    }) // Include BOM for UTF-8

    const a = document.createElement("a")
    a.href = URL.createObjectURL(blob)
    a.setAttribute("download", `products-${new Date().toISOString()}.csv`)
    document.body.appendChild(a)
    a.click()
    document.body.removeChild(a)
  }

  const exportPDF = () => {
    const unit = "pt"
    const size = "A4" // Use A3, A4, A5, etc.
    const orientation = "portrait" // portrait or landscape
    const marginLeft = 40 // Left padding

    const font: any = ''
    
    var callAddFont = function (this: any) {
      this.addFileToVFS("Kanit-Regular-normal.ttf", font)
      this.addFont("Kanit-Regular-normal.ttf", "Kanit-Regular", "normal")
    }
    jsPDF.API.events.push(["addFonts", callAddFont])

    // New PDF instance
    const doc: any = new jsPDF(orientation, unit, size)

    // Set font
    doc.setFont("Kanit-Regular")

    // Set font size
    doc.setFontSize(14)

    // Set the document title with date
    const title = `รายงานสินค้า - ${new Date().toLocaleDateString()}`

    // Set the table headers
    const headers = [["#", "Product", "Category", "Price", "Unit", "Created"]]

    // Set the table data with rows auto generated
    const data = products.map((product: Product, index: number) => [
      index + 1,
      product.product_name,
      product.category_name,
      `$${numberWithCommas(product.unit_price)}`,
      product.unit_in_stock,
      formatDate(product.created_date),
    ])

    // Set the table options
    doc.autoTable({
      head: headers,
      body: data,
      startY: 60,
      theme: "grid",
      margin: { top: 60, right: 40, bottom: 20, left: 40 },
      styles: { font: "Kanit-Regular", fontSize: 10, cellPadding: 5 }, // Increased font size and padding for better readability
      columnStyles: {
        0: { cellWidth: 30 },
        1: { cellWidth: "auto" },
        2: { cellWidth: 100 },
        3: { cellWidth: 80 },
        4: { cellWidth: 40 },
        5: { cellWidth: 80 },
      },
    })

    // Set the document title
    doc.text(title, marginLeft, 40)

    // Set the document date
    // doc.text(`Date: ${new Date().toLocaleDateString()}`, marginLeft, 60)

    // Set the document page number
    const totalPages = doc.internal.getNumberOfPages()

    for (let i = 1; i <= totalPages; i++) {
      doc.setPage(i)
      doc.text(`Page ${i} of ${totalPages}`, 500, 800)
    }

    // PDF name as datetime
    const pdfName = `products-report-${new Date().toISOString()}.pdf`

    // Save the PDF
    doc.save(pdfName)
  }

  return (
    <>
      <Box>
        <Button
          variant="outlined"
          color="primary"
          onClick={exportPDF}
          sx={{ marginLeft: 2, height: '50px' }}
        >
          <IconPdf size={28} /> &nbsp;Export
        </Button>
      </Box>
      <Box>
        <Button
          variant="outlined"
          color="primary"
          onClick={exportCSV}
          sx={{ marginLeft: 2, height: '50px' }}
        >
          <IconCsv size={28} /> &nbsp;Export
        </Button>
      </Box>
    </>
  )
}

export default ExportProduct
